import { Component } from 'react'

class SearchAddExportForm extends Component{
    render(){
        return(
            <div className='SearchAddExportForm'>
                <input type='text' placeholder='Search' />
                <button>Add Contact</button>
                <button>Export Contact</button>
            </div>
        )
    }
}

export default SearchAddExportForm
